import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import logo from '../WhatsApp Image 2025-03-08 at 17.24.45_cbe09b27.jpg';
import "../App.css";

const Navbar = () => {
  const [isScrolled, setIsScrolled] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setIsScrolled(true);
      } else {
        setIsScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  return (
    <div className={`container-fluid ${isScrolled ? 'navbar-scrolled' : ''}`} id='navbar'>
      <div className="row">
        <div className="col-md-12">
          <nav className="navbar navbar-expand-lg">
            <div className="container-fluid">
              <Link className="navbar-brand" to="/">
                <img src={logo} alt='random' style={{width:"153px", height:"39px", mixBlendMode:"lighten"}}/>
              </Link>
              <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon" />
              </button>
              <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
                  <li className="nav-item">
                    <Link className="nav-link active" aria-current="page" to="/Home">HOME</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link active" aria-current="page" to="/category">CATEGORIES</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/About">ABOUT US</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/">SUBSCRIPTIONS</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/">CONTACT</Link>
                  </li>
                  <form className="d-flex">
                    <input className="form-control me-2" type="search" placeholder="SEARCH DISHES" aria-label="Search" id="input" />
                    <span className="material-symbols-outlined search-icon">search</span>
                  </form>
                </ul>
              </div>
            </div>
          </nav>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
